import React, { useState } from "react";

const Delete = () => {
 const [name, setName] = useState("");

 const handleSubmit = async (event) => {
   event.preventDefault();

   const response = await fetch("http://localhost:8080/delete/" + name, {
     method: "POST",
   });

   if (response.ok) {
     alert("Record deleted for " + name);
   } else {
     alert("Failed to delete record for " + name);
   }
 };

 return (
   <div className="container">
     <div className="center">
         <h1>Delete</h1>
         <form onSubmit={handleSubmit}>
             <div className="txt_field">
                 <input type="text" name="name" required value={name}></input>
                 <span></span>
                 <label>Name</label>
             </div>
             <input name="submit" type="Submit" value="Delete"></input>
             </form>
             </div>
             </div>
 );
};

export default Delete;
